import Layout from '../components/layout';
import Plot from 'react-plotly.js';

const Chart = () => (
    <Layout>
        <Plot
            data={[
                {
                    x: ["Frank", "Jerry", "Jill", "Regis", "Tracy"],
                    y: [2, 6, 3],
                    type: 'histogram',
                    mode: 'lines+markers',
                    marker: { color: 'green' },
                },
                // { type: 'bar', x: [1, 2, 3], y: [2, 5, 3] },
            ]}
            layout={{ width: 450, height: 450, title: 'Name vs WPM' }}
        />    </Layout>
);

export default Chart;
